<!DOCTYPE html>
<html>

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>PAL Custom Color Palete Editor (by Rain Viewer, MeteoLab Inc.)</title>
    <style>
        body {
            margin: 0;
            padding: 0;
            height: 100vh;
            background-image: url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAEEAAABBCAMAAAC5KTl3AAAASFBMVEXw8PDv7+/x8fHz8/P4+Pj+/v7////9/f329vby8vLu7u75+fnt7e36+vr+/f77+/v8/Pz5+Pn09PT19fX6+frs7Oz9/P339/fIlyDPAAAAxElEQVR4Ae3VVQLCMBBF0TfxtDF8/zvFHYYPHOYs4LZxgM5hR2ljneV4EGeRCNbxQCxo46UgBSlI4RJEY+8r0PsL3W8Uuti7uwrpEwrp/oK+t9DpfFdh4dYoioW+IdTGGVTUzOmD1sPRZWFhhCHcRXbNlXGcpO4yWugmgLPn/NZ0WkdsgboO7gK718Kko8uwRATH8yHxBfxRgdHRXQUpSEEKUuDgSQW7tSjMOsLCPQXCpxeg7p2HRWHqON7E9Vpce7sVzQHAP0V6I9yqlAAAAABJRU5ErkJggg==");
            background-repeat: repeat;
            background-size: 16px 16px;
        }

        .container {
            display: flex;
            width: 100%;
            height: 100%;
        }

        .container>div {
            padding: 10px;
            display: flex;
            flex-direction: column;
        }

        textarea {
            width: 100%;
            resize: none;
            font-family: monospace;
            padding: 10px;
            box-sizing: border-box;
        }

        h1,
        h2,
        h3,
        h4 {
            margin: 10px 0 4px;
        }

        pre {
            margin: 0;
        }

        .textarea-container {
            flex: 1;
            max-width: 360px;
        }

        .preview-container {
            flex: 2;
            box-sizing: border-box;
        }

        .preview-container img {
            width: 100%;

            background-size: contain;
            background-position: center;
            background-repeat: no-repeat;
        }

        .gradient-preview {
            width: 100%;

            position: relative;
        }

        .marker {
            position: absolute;
            top: 0;
            width: 2px;
            height: 20px;

        .gradient-blocks-preview {
            display: flex;
            width: 100%;
            height: 20px;
            position: relative;
        }

        .marker-block {
            flex: 1;
        }

        .marker-pos {
            width: 1px;
            height: 20px;
            background-color: rgba(0, 0, 0, 0.2);

            color: rgba(0, 0, 0, 0.2);

        .file-selector {
            display: flex;

            box-sizing: border-box;

<body>
    <ul class="file-selector">
        <li>Files</li>
        <li><input type="file" id="image-upload" accept="image/*"></li>
        <li><input type="button" value="COMP" onclick="setImage(2)"></li>
        <li><input type="button" value="KABX" onclick="setImage(0)"></li>
        <li><input type="button" value="SAT IR" onclick="setImage(1)"></li>
        <li>Source BW:</li>
        <li>Min<input type="number" id="min-output" size="5" style="width: 40px;">-32</li>
        <li>Max<input type="number" id="max-output" size="5" style="width: 40px;">95</li>
        <li>Output Units:</li>
        <li>Min<input type="number" id="min-value" size="5" style="width: 40px;">0</li>
        <li>Max<input type="number" id="max-value" size="5" style="width: 40px;">127</li>
        <li><input type="button" value="RESET" id="reset"></li>
    </ul>

    <div id="color-preview" class="gradient-preview"></div>
    <div id="palette-preview" class="gradient-blocks-preview"></div>

    <div class="container">
        <div class="textarea-container" style="background-color:#eec;">
            <h3>Color Palete</h3>
            <textarea id="pal-input" rows="24"></textarea>

            <h4>CSS Colors</h4>
            <small><pre><code id="css-colors"></code></pre></small>

            <h4>CSS Linear Gradient</h4>
            <small><pre><code id="lineral-gradient"></code></pre></small>
        </div>
        <div class="preview-container">
            <h3>Preview</h3>
            <img id="image-preview">
        </div>
    </div>

    <script>
        let imageData;
        let imageNumber = 3;
        let minValue;
        let maxValue;
        let minOutput;
        let maxOutput;

        const trackValues = {
            'pal-input': '; The Weather Channel \n\
product: BR \n\
Units: DBZ \n\
\n\
Color: 5 99 235 99 \n\
Color: 10 99 235 99 \n\
Color: 15 61 198 61 \n\
Color: 20 31 158 52 \n\
Color: 25 17 103 25 \n\
SolidColor: 34 2 48 2 \n\
Color: 35 255 255 0 \n\
Color: 40 255 127 0 \n\
Color: 45 230 0 0 \n\
Color: 50 205 0 0 \n\
Color: 55 155 0 0 \n\
Color: 60 130 0 0 \n\
Color: 65 105 0 0 234 0 247 \n\
Color: 70 255 255 255  \n\
            ',
            'min-value': -32,
            'max-value': 95,
            'min-output': 0,
            'max-output': 127
        }

        document.addEventListener('DOMContentLoaded', () => {
            for (let input of Object.keys(trackValues)) {
                const inputElement = document.getElementById(input);
                const inputLocalValue = localStorage.getItem(input);

                if (typeof inputLocalValue !== 'undefined' && inputLocalValue !== null) {
                    trackValues[input] = inputLocalValue;
                }
                inputElement.value = trackValues[input];

                document.getElementById(input).addEventListener('input', () => {
                    const inputValue = document.getElementById(input).value;

                    localStorage.setItem(input, inputValue);
                    trackValues[input] = inputValue;

                    updateGradientAndPreview();
                });
            }
            document.getElementById('image-upload').addEventListener('change', function () {
                imageNumber = -1;
                updateGradientAndPreview();
            });
            document.getElementById('reset').addEventListener('click', function () {
                setDefault();
                updateGradientAndPreview();
            });
            updateGradientAndPreview();
            setImage(2);
        });

        function setDefault() {
            trackValues['min-value'] = -32;
            trackValues['max-value'] = 95;
            trackValues['min-output'] = 0;
            trackValues['max-output'] = 127;

            for (let input of Object.keys(trackValues)) {
                const inputElement = document.getElementById(input);
                inputElement.value = trackValues[input];
                localStorage.setItem(input, trackValues[input]);
            }
            updateGradientAndPreview();
        }

        function parsePalFile(content) {
            let colors = [];
            if (!content) {
                return colors;
            }

            let lines = content.toLowerCase().split('\n');
            for (let line of lines) {
                let match = line.match(/^((?:solid)?color4?)\:\s*([-\d.\s]+)/);
                if (match) {
                    let [, type, valuesStr] = match;
                    let values = valuesStr.trim().split(/\s+/).map(Number);
                    let dbz = values.shift();
                    let r = values.shift();
                    let g = values.shift();
                    let b = values.shift();
                    let a = type === 'color4' ? values.shift() : 255;
                    let r2 = values.shift();
                    let g2 = values.shift();
                    let b2 = values.shift();
                    let a2 = type === 'color4' ? values.shift() : 255;
                    let solid = type === 'solidcolor' || type === 'solidcolor4' ? true : false;

                    colors.push({ dbz, solid, r, g, b, a, next: { r: r2, g: g2, b: b2, a: a2 } });
                }
            }
            colors.sort((a, b) => a.dbz - b.dbz);
            return colors;
        }

        function getPaletteColors(colors, min, max, output_min, output_max) {
            const outputRange = output_max - output_min + 1;
            const palette = new Array(outputRange).fill({ r: 0, g: 0, b: 0, a: 0 });

            function interpolateColor(color1, color2, factor) {
                const r = Math.round(color1.r + factor * (color2.r - color1.r));
                const g = Math.round(color1.g + factor * (color2.g - color1.g));
                const b = Math.round(color1.b + factor * (color2.b - color1.b));
                const a = Math.round(color1.a + factor * (color2.a - color1.a));
                return { r, g, b, a };
            }

            let currentColor = { dbz: min, r: 0, g: 0, b: 0, a: 0, solid: true };
            let nextColor = colors[0];

            for (let i = output_min; i <= output_max; i++) {
                const dbz = min + (i - output_min) * (max - min) / (output_max - output_min);

                while (nextColor && dbz >= nextColor.dbz) {
                    currentColor = nextColor;
                    nextColor = colors.shift();
                }

                if (nextColor) {
                    if (currentColor.solid) {
                        palette[i] = { r: currentColor.r, g: currentColor.g, b: currentColor.b, a: currentColor.a };
                    } else {
                        const factor = (dbz - currentColor.dbz) / (nextColor.dbz - currentColor.dbz);

                        palette[i] = interpolateColor(currentColor, currentColor.next.r !== undefined ? currentColor.next : nextColor, factor);
                    }
                } else {
                    palette[i] = { r: currentColor.r, g: currentColor.g, b: currentColor.b, a: currentColor.a };
                }
            }
            return palette;
        }

        function updateColorPreview(colors) {
            const colorPreview = document.getElementById('color-preview');
            colorPreview.innerHTML = '';
            const gradientStops = [];
            const cssColors = [];

            const minValue = Number(trackValues['min-value']);
            const maxValue = Number(trackValues['max-value']);
            const totalValues = maxValue - minValue;

            // Ensure the first color starts at -32 dBZ and is always black transparent solid
            if (colors.length > 0) {
                gradientStops.push(`rgba(0, 0, 0, 0) 0%`);

                const nextDbzPercentage = ((colors[0].dbz - minValue) / totalValues * 100).toFixed(2);
                if (nextDbzPercentage >= 0 && nextDbzPercentage <= 100) {
                    gradientStops.push(`rgba(0, 0, 0, 0) ${nextDbzPercentage}%`);
                }
            }

            // Add colors from the .pal file, ensuring solid colors span their range
            let prevColor = colors[0];
            for (let i = 0; i < colors.length; i++) {
                const color = colors[i];
                const dbzPercentage = (((color.dbz - minValue) / totalValues) * 100).toFixed(2);

                if (dbzPercentage < 0 || dbzPercentage > 100) {
                    continue;
                }
                gradientStops.push(`rgba(${color.r}, ${color.g}, ${color.b}, ${(color.a / 255).toFixed(2)}) ${dbzPercentage}%`);

                // insert square div with RGB color and text representative of #RRGGBB without alpha into cssColors
                cssColors.push(`${color.dbz}: #${color.r.toString(16).padStart(2, '0')}${color.g.toString(16).padStart(2, '0')}${color.b.toString(16).padStart(2, '0')} <div style="background-color: rgba(${color.r}, ${color.g}, ${color.b}, ${(color.a / 255).toFixed(2)});width:20px;height:10px;display:inline-block;"></div>`);
                

                const marker = document.createElement('div');
                marker.classList.add('marker');
                marker.textContent = `${color.dbz}`;
                marker.style.left = `${dbzPercentage}%`;
                colorPreview.appendChild(marker);

                if ((color.solid || color.next.r !== undefined) && i < colors.length - 1) {
                    const nextDbzPercentage = (((colors[i + 1].dbz - minValue) / totalValues) * 100).toFixed(2);
                    if (nextDbzPercentage < 0 || nextDbzPercentage > 100) {
                        continue;
                    }
                    if (color.next.r !== undefined) {
                        gradientStops.push(`rgba(${color.next.r}, ${color.next.g}, ${color.next.b}, ${(color.next.a / 255).toFixed(2)}) ${nextDbzPercentage}%`);
                    }
                    else {
                        gradientStops.push(`rgba(${color.r}, ${color.g}, ${color.b}, ${(color.a / 255).toFixed(2)}) ${nextDbzPercentage}%`);
                    }
                }
                prevColor = color;
            }

            if (colors.length > 0) {
                const lastColor = colors[colors.length - 1];
                gradientStops.push(`rgba(${lastColor.r}, ${lastColor.g}, ${lastColor.b}, ${(lastColor.a / 255).toFixed(2)}) 100%`);
            }

            colorPreview.style.background = `linear-gradient(to right, ${gradientStops.join(', ')})`;

            // show gradient in lineral-gradient element
            document.getElementById('lineral-gradient').innerHTML = `linear-gradient(180deg, \n  ${gradientStops.join(",\n  ")}\n)`;
            document.getElementById('css-colors').innerHTML = cssColors.join('\n');
        }

        function updatePalettePreview(palette) {
            const palettePreview = document.getElementById('palette-preview');
            palettePreview.innerHTML = '';
            const gradientStops = [];
            const minValue = Number(trackValues['min-value']);

            for (let i = 0; i < palette.length; i++) {
                const color = palette[i];
                const precentage = (1 / palette.length) * 100;

                const marker = document.createElement('div');
                marker.classList.add('marker-thin');
                marker.style.backgroundColor = `rgba(${color.r}, ${color.g}, ${color.b}, ${color.a / 255})`;
                marker.style.width = `${precentage}%`;
                marker.innerHTML = '<div class="marker-pos">' + (minValue + i) + '</div>';
                palettePreview.appendChild(marker);
            }
        }

        function updateImagePreview(colors, palette, src) {
            let canvas = document.createElement('canvas');
            let ctx = canvas.getContext('2d');
            let img = new Image();
            img.onload = function () {
                canvas.width = img.width;
                canvas.height = img.height;
                ctx.drawImage(img, 0, 0);

                imageData = ctx.getImageData(0, 0, canvas.width, canvas.height);
                let data = imageData.data;

                for (let i = 0; i < data.length; i += 4) {
                    let grayscale = data[i];
                    if (grayscale < trackValues['min-output'] || grayscale > trackValues['max-output']) {
                        continue;
                    }

                    let color = palette[data[i]];
                    data[i] = color.r;
                    data[i + 1] = color.g;
                    data[i + 2] = color.b;
                    data[i + 3] = color.a;
                }
                ctx.putImageData(new ImageData(data, canvas.width, canvas.height), 0, 0);

                document.getElementById('image-preview').style.backgroundImage = `url(${canvas.toDataURL()})`;
            }
            img.src = src;
        }

        function updateGradientAndPreview(image) {
            let colors = parsePalFile(trackValues['pal-input']);
            updateColorPreview(colors);

            let palette = getPaletteColors(
                colors,
                Number(trackValues['min-value']),
                Number(trackValues['max-value']),
                Number(trackValues['min-output']),
                Number(trackValues['max-output'])
            );
            updatePalettePreview(palette);

            if (imageNumber >= 0 && imageNumber < images.length) {
                updateImagePreview(colors, palette, images[imageNumber]);
            }
            else if (imageNumber == -1 && document.getElementById('image-upload').files.length > 0) {
                updateImagePreview(colors, palette, URL.createObjectURL(document.getElementById('image-upload').files[0]));
            }
        }

        function setImage(position) {
            imageNumber = position;
            updateGradientAndPreview();
        }

        const images = [
